import React from 'react';
import PropTypes from 'prop-types';

function Item(props) {
  const { content, selectedItem } = props;
  return (
    <div onClick={() => selectedItem(content)} className="Item">
      {content}
    </div>
  );
}

export default Item;

Item.propTypes = {
  content: PropTypes.string.isRequired,
};
